function getUsuario(user) {

	var c1 = DatasetFactory.createConstraint("colleaguePK.colleagueId", user,user, ConstraintType.MUST);
	var datasetUser = DatasetFactory.getDataset("colleague", null, [ c1 ], null);
	var colleague = '';
	if (datasetUser.rowsCount > 0) {
		colleague =  datasetUser.getValue(0, "colleagueName");
	}
	return colleague;
	
}


function addfilho(idUsuario, nome, dataHoraCorrente, departamento, status, descricao) {	
	
    var childData = new java.util.HashMap();    
    childData.put("historicoidusuario", idUsuario);
    childData.put("historicousuario", nome);
    childData.put("historicodata", dataHoraCorrente);
    childData.put("historicodepartamento", departamento);
    childData.put("historicostatus", status); 
    childData.put("historicodescricao", descricao);       
	hAPI.addCardChild('tabelaHistorico', childData);
	
}


function obterDataHoraCorrente() {
	
	var today = new Date();
	var year = today.getFullYear();
	var month = (today.getMonth() + 1) < 10 ? '0' + (today.getMonth() + 1)	: (today.getMonth() + 1);
	var day = today.getDate() < 10 ? '0' + today.getDate() : today.getDate();		
	var hour = today.getHours() < 10 ? '0' + today.getHours() : today.getHours();
	var minute = today.getMinutes() < 10 ? '0' + today.getMinutes() : today.getMinutes();
	var second = today.getSeconds() < 10 ? '0' + today.getSeconds() : today.getSeconds();
	var currentHour = hour + ":" + minute + ":" + second;
	var currentDate = day + '/' + month + '/' + year;
	var currentTime = currentDate + "  " + currentHour;
	
	return currentTime;
	
}


function obterSubareaUnidade ( grupoResponsavel ) {
	var cst1 = DatasetFactory.createConstraint('GpResponsavel', grupoResponsavel, grupoResponsavel, ConstraintType.MUST);
	var colunas = new Array('CodSubarea', 'CodArea', 'NomeSubarea', 'GpResponsavel');
	var dtsSubareaUnidade = DatasetFactory.getDataset('dsSubareasUnidadeDaInstituicao', colunas, new Array(cst1), new Array('NomeSubarea'));
	for (var x = 0; x < dtsSubareaUnidade.rowsCount; x++) {		
		if (dtsSubareaUnidade.getValue(x, "GpResponsavel") == grupoResponsavel ) {
			return dtsSubareaUnidade.getValue(x, "NomeSubarea");
		}
	}	
}


function obterUnidade ( grupoResponsavel ) {
	var cst1 = DatasetFactory.createConstraint('GpResponsavel', grupoResponsavel, grupoResponsavel, ConstraintType.MUST);
	var colunas = new Array('CodUnidade', 'NomeUnidade', 'GpResponsavel');
	var dtsUnidade = DatasetFactory.getDataset('dsUnidadesDaInstituicao', colunas, new Array(cst1), new Array('NomeUnidade'));
	for (var x = 0; x < dtsUnidade.rowsCount; x++) {		
		if (dtsUnidade.getValue(x, "GpResponsavel") == grupoResponsavel ) {
			return dtsUnidade.getValue(x, "NomeUnidade");
		}
	}	
}

function setProcess(processId){
	
	
	var user = getValue("WKUser");	
	var cardId = getValue("WKCardId");
	hAPI.setCardValue("idProcesso", processId);

    var cst1 = DatasetFactory.createConstraint("metadata#active", true, true, ConstraintType.MUST);
	var cst2 = DatasetFactory.createConstraint("userSecurityId", user, user, ConstraintType.MUST);
	var cst3 = DatasetFactory.createConstraint("metadata#id", cardId, cardId, ConstraintType.MUST);
	
    var constraints = new Array(cst1, cst2, cst3);   
    var datasetPrincipal = DatasetFactory.getDataset("dsCIPessoal", null, constraints, null);	
    
    for (var x = 0; x < datasetPrincipal.rowsCount; x++) {   	
    	
		var iddocumento = datasetPrincipal.getValue(x, "documentid");
	    var unidade = datasetPrincipal.getValue(x, "unidade");
	    var areaunidade = datasetPrincipal.getValue(x, "areaunidade");
	    var subareaunidade = datasetPrincipal.getValue(x, "subareaunidade");
	    var assunto = datasetPrincipal.getValue(x, "assunto");
	    
	    hAPI.setCardValue("iddocumento", iddocumento);
	    hAPI.setCardValue("unidadeselecionada", unidade);
	    hAPI.setCardValue("areaselecionada", areaunidade);
	    hAPI.setCardValue("subareaselecionada", subareaunidade);
	    hAPI.setCardValue("assuntoselecionado", assunto);    
	    
	    
    }    
	
	
	
}
